clone.haxe_doc:
Clone the object.
Null values, strings, dates, numbers, enums and functions are immutable so will be returned as is. Anonymous objects will be created and each field cloned recursively. Arrays will be recreated and each object cloned recursively. Class instances will either be cloned, or the reference copied, depending on the value of `cloneInstances`.
@param v The object which will be cloned. @param cloneInstances If true, class instances will be cloned using `Type.createEmptyInstance` and `Reflect.setField`. If false, class instances will be re-used, not cloned. Default is false.

lift.haxe_doc:
Converts an instance of type `T` to an instance of type `U`.

Useful as an extension methods for converting a value to another type inside a chain of function calls.

E.g.

```
using thx.Functions;
import thx.Options;

var arr: Array<Int> = [1, 2, 3];
var opt : Option<Array<Int>> = myArray.lift(Options.ofValue);
Assert.same(Some(arr), opt); // true
```

order.expr:
function(i0, i1) {
	return if (i0 > i1) GT else if (i0 == i1) EQ else LT;
}

m.e:
function(i0, i1) {
	return if (i0 > i1) GT else if (i0 == i1) EQ else LT;
}

or.haxe_doc:
Like `opt` but allows an `alt` value that replaces a `null` occurrance.

```haxe
var s : String = null;
trace(s.or('b')); // prints 'b'
s = 'a';
trace(s.or('b')); // prints 'a'

// or more complex
var o : { a : { b : { c : String }}} = null;
trace((o.a.b.c).or("B")); // prints 'B'
var o = { a : { b : { c : 'A' }}};
trace((o.a.b.c).or("B")); // prints 'A'
```

Notice that the subject `value` must be a constant identifier (eg: fields, local variables, ...).

setPath.haxe_doc:
Sets a value in an object by a string path. The path can contain object keys and array indices separated by ".". Returns the original object, for optional chaining of other object methods.
Inner objects and arrays will be created as needed when traversing the path.
E.g. { key1: { key2: [1, 2, 3] } }.setPath("key1.key2.2", 4) -> returns { key1: { key2: [ 1, 2, 4 ] } }

monoid.expr:
{ zero : EQ, append : function(o0:Ordering, o1:Ordering):Ordering return switch o0 {
	case LT:
		LT;	
	case EQ:
		o1;	
	case GT:
		GT;	
} }

m.e:
{ zero : EQ, append : function(o0:Ordering, o1:Ordering):Ordering return switch o0 {
	case LT:
		LT;	
	case EQ:
		o1;	
	case GT:
		GT;	
} }

class.haxe_doc:
`Timer` provides several meaning to delay the execution of code. At the moment it is only
implemented for platforms that have a native concept of Timer like Swf and JavaScript or c++/Neko
with OpenFL or NME.

All of the Timer methods return a function with signature Void -> Void that can be used to cancel
the timer.

```haxe
// set the execution delayed by 200ms
var cancel = Timer.delay(doSomethingLater, 200);

// cancel immediately (doSomethingLater will never be executed)
cancel();
```

Note that calling the cancel function multiple times have no effect after the first execution.

